import React from 'react';

const List = ({ list }) => {
    return (
        <div style={{
            textAlign: 'left',
            width: '380px',
            marginLeft: '15px',
            marginTop: '20%', 
            padding: '10px',
            color: '#fff',
        }}>
            {list && (
                <ul style={{ listStyle: 'none', height }}>
                    {list.map((e, i) => (
                        <li>{i + 1}. {e}</li>
                    ))}
                </ul>
            )}
        </div>
    )
}

export default List;
